import { StyleSheet } from "react-native"


const styles = StyleSheet.create({

    header:{
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-around',
        gap: 70,
        position: 'fixed',
        top:0,
        left: 0,
        paddingLeft: 30,
        paddingTop: 80,
        }
})

export default styles;
